import React from 'react';

function Projects() {
  const projects = [
    { id: 1, title: 'E-commerce Platform', description: 'A full-stack e-commerce platform built with React and Node.js', image: '/placeholder-project1.jpg', link: '#' },
    { id: 2, title: 'Task Management App', description: 'A React-based task management application with drag-and-drop functionality', image: '/placeholder-project2.jpg', link: '#' },
    { id: 3, title: 'Weather Dashboard', description: 'A weather dashboard that fetches and displays real-time weather data', image: '/placeholder-project3.jpg', link: '#' },
  ];

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-bold text-purple-600 mb-4">My Projects</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {projects.map(project => (
          <div key={project.id} className="border border-purple-200 rounded p-4">
            <img src={project.image} alt={project.title} className="w-full h-48 object-cover mb-2" />
            <h2 className="text-2xl font-bold text-purple-600 mb-2">{project.title}</h2>
            <p className="text-black mb-2">{project.description}</p>
            <a href={project.link} className="text-purple-600 hover:underline">View Project</a>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Projects;
